(1211, '_transient_jupiterx_admin_widget_posts', 'a:3:{i:0;a:25:{s:2:\"id\";i:134902;s:4:\"date\";s:19:\"2021-11-04T19:17:30\";s:8:\"date_gmt\";s:19:\"2021-11-04T16:17:30\";s:4:\"guid\";a:1:{s:8:\"rendered\";s:36:\"https://themes.artbees.net/?p=134902\";}s:8:\"modified\";s:19:\"2021-11-04T19:52:23\";s:12:\"modified_gmt\";s:19:\"2021-11-04T16:52:23\";s:4:\"slug\";s:59:\"migrate-a-wordpress-site-from-one-hosting-server-to-another\";s:6:\"status\";s:7:\"publish\";s:4:\"type\";s:4:\"post\";s:4:\"link\";s:92:\"https://themes.artbees.net/blog/migrate-a-wordpress-site-from-one-hosting-server-to-another/\";s:5:\"title\";a:1:{s:8:\"rendered\";s:66:\"How to Migrate a WordPress Site from One Hosting Server to Another\";}s:7:\"content\";a:2:{s:8:\"rendered\";s:25495:\"\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full\"><img width=\"1200\" height=\"600\" src=\"https://themes.artbees.net/wp-content/uploads/2021/11/blog-migrate-hosting-1.png\" alt=\"\" class=\"wp-image-134932\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/blog-migrate-hosting-1.png 1200w, https://themes.artbees.net/wp-content/uploads/2021/11/blog-migrate-hosting-1-300x150.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/blog-migrate-hosting-1-1024x512.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/blog-migrate-hosting-1-768x384.png 768w\" sizes=\"(max-width: 1200px) 100vw, 1200px\" /></figure></div>\n\n\n\n<p>Website migration is the process of changing a website configuration or technology that can affect its online visibility and search engine optimization. A site migration includes changes such as changing the domain name or switching the hosting provider and server location, changing the structure of the site, site redesign, moving from HTTP to HTTPS protocol and moving the site to a new platform (CMS or Framework). In this article we will focus on changing the hosting server as the main process to migrate a WordPress site.</p>\n\n\n\n<p>The reason for the migration is obvious when it comes to uploading a site on a production server after its development in the local environment, since the site needs to be made publicly available. If you are considering transferring an already working site from one server to another one, then there may be several most common reasons for that:</p>\n\n\n\n<ul><li>Balanced pricing plan</li><li>More hosting resources and useful features</li><li>Good server security</li><li>Great customer support</li></ul>\n\n\n\n<p>So if you are ready to publish your site or decide to switch to a new hosting provider, you will be faced with the question of how to migrate it. Here we will consider the technical aspects of two&nbsp; methods for migrating a WordPress site to a new server: a plugin-based method using the most popular migration plugins and a manual method.&nbsp;</p>\n\n\n\n<p>The main risks involved in moving a site are data loss and downtime, which can make your site inaccessible for users and search engines, which in turn can lead to search engine rankings loss. Nevertheless, if everything is done in the right way, downtime will be minimized or won’t happen at all.&nbsp;</p>\n\n\n\n<h2 id=\"h-choosing-and-setting-up-the-new-hosting-environment\">Choosing and setting up the new hosting environment</h2>\n\n\n\n<p>If you are looking for information on how to migrate the website, you clearly have reasons why you are leaving your current hosting provider and you don’t want to suffer any problems on a new host. There are different kinds of hostings available to choose from and it’s important to understand how they work. Here is a list of hosting types:&nbsp;</p>\n\n\n\n<ul><li><strong>Shared hosting</strong> &#8211;&nbsp; Usually the most common type of hosting, when one server houses many websites and shares resources between them.</li><li><strong>Virtual Private Server (VPS)</strong> &#8211;&nbsp; The virtual partitions of a dedicated physical server are used in this hosting type and an actual area of the server is dedicated to your site.</li><li><strong>Dedicated server</strong> &#8211; A physical server supports only your website and you have&nbsp; full access to the server’s resources.</li><li><strong>Managed and WordPress optimized hosting</strong> &#8211; A hosting service where all WordPress technical aspects are managed by the hosting provider. This type of hosting includes technologies and tools that help your site run smoothly.</li></ul>\n\n\n\n<p>Before starting to migrate your site, you need to add your site (domain name) to the new hosting panel so that the necessary records will be created for your domain on a new server.</p>\n\n\n\n<p><em>An important thing to remember: Don’t cancel your current hosting plan before the migration and further testing are completed, as you could lose your entire site&#8217;s data.</em></p>\n\n\n\n<h2 id=\"h-backing-up-the-site-before-you-get-started\">Backing up the site before you get started</h2>\n\n\n\n<p>A good practice before making any crucial changes to the site is making a full backup (site files and database). It can be done manually or with the help of any backup WordPress plugin. Since creating a backup is one of the steps of site transfer, we will cover it later in this article.</p>\n\n\n\n<h2 id=\"h-the-plugins-based-method-to-migrate-a-wordpress-site\">The plugins-based method to migrate a WordPress site</h2>\n\n\n\n<p>Migrating a WordPress site using any cloning plugin is a popular solution that helps to ease the process: Just install the plugin and make a few clicks. There are dozens of WordPress plugins for migration in the repository. However, in this article we will consider the two most popular ones: All-in-One WP Migration and Duplicator.</p>\n\n\n\n<h3 id=\"h-the-all-in-one-wp-migration-plugin\">The All-in-One WP Migration plugin</h3>\n\n\n\n<p>The<a href=\"https://wordpress.org/plugins/all-in-one-wp-migration/\"> All-in-One WP Migration</a> plugin specializes in website migration and provides all the necessary tools for that. It’s easy to use and has drag-and-drop import functionality, which simplifies the migration process.</p>\n\n\n\n<p>At first you need to install and activate the cloning plugin on your old and new hosting environment. To do that, log in to your site’s WP Dashboard, navigate to the <strong>Plugins &gt; Add New</strong> section, type the plugin name in the <strong>Search</strong> field and then click the <strong>Install Now</strong> button for the necessary plugin.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/Install_All-in-One-WP_Migration.png\" alt=\"migrate a WordPress site\" class=\"wp-image-134914\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/Install_All-in-One-WP_Migration.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/Install_All-in-One-WP_Migration-300x153.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/Install_All-in-One-WP_Migration-1024x522.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/Install_All-in-One-WP_Migration-768x392.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/Install_All-in-One-WP_Migration-1536x783.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>When installation is complete, just click the <strong>Activate</strong> button to turn on the plugin.</p>\n\n\n\n<p>The steps below will show you how to move your WordPress site.</p>\n\n\n\n<p>1. In the WP Dashboard of the site you want to move, go to the <strong>All-in-One WP Migration</strong> -&gt; <strong>Export</strong> section.</p>\n\n\n\n<p>2. Select the <strong>File</strong> option from the <strong>Export to</strong> dropdown menu.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-1st-step.png\" alt=\"\" class=\"wp-image-134915\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-1st-step.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-1st-step-300x132.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-1st-step-1024x450.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-1st-step-768x338.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-1st-step-1536x675.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>3. Wait for the plugin to finish exporting the site data and then download the generated file in the <strong>.wpress</strong> format.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-3.png\" alt=\"migrate a WordPress site\" class=\"wp-image-134916\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-3.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-3-300x110.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-3-1024x375.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-3-768x281.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-3-1536x563.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>4. Log in to your new site’s WP Dashboard and navigate to the <strong>All-in-One WP Migration</strong> -&gt; <strong>Import</strong> section.</p>\n\n\n\n<p>5. Click the <strong>Import</strong> <strong>from </strong>buttonand select the <strong>File</strong> option.After that, locate the <strong>.wpress</strong> file you downloaded in step 3.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-5.png\" alt=\"\" class=\"wp-image-134918\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-5.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-5-300x107.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-5-1024x366.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-5-768x274.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/All-in-One-step-5-1536x548.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>6. Click the <strong>Finish</strong> button once the import process is completed. In case the backup file can’t be uploaded via the web interface due to the <em>max_upload_filesize</em> limitation, you can upload it via File Manager in your hosting panel or via FTP. Upload the generated .wpress file into the <strong>wp-content/ai1wm-backups</strong> folder of your new site and then it should be displayed in <strong>WP Dashboard &gt; All-In-One WP Migration &gt; Backups</strong>. Click the <strong>Restore</strong> button and proceed with the restoration process. When migration is done you need to resave the permalinks structure in <strong>WP Dashboard &gt; Settings &gt; Permalinks</strong>, so it will regenerate the <em>.htaccess</em> file.</p>\n\n\n\n<p><em>Important note</em>, All-in-One Migration is a freemium plugin and it has free and premium features, but one of the main limitations you need to pay attention to is the size of the site’s backup file. If it’s bigger than 512M, you need to have a premium version of the plugin to proceed with the migration process.</p>\n\n\n\n<h3 id=\"h-the-duplicator-plugin\">The Duplicator plugin</h3>\n\n\n\n<p><a href=\"https://wordpress.org/plugins/duplicator/\" rel=\"nofollow\">Duplicator</a> is another migration plugin that is also on the list of the best WordPress migration plugins. With the help of this plugin you can simply clone your site to a new server without downtime. When migrating, Duplicator creates a package with all the pre-configured files, so you don’t even need to install WordPress on your new host, as Duplicator does it itself.</p>\n\n\n\n<p>The plugin installation is the same as the one&nbsp; described in the previous section. Once it is installed and activated, you will see the Duplicator menu in the WP Dashboard panel.The following steps will show the process of migrating the WordPress site using Duplicator.</p>\n\n\n\n<ol><li>Opent the <strong>Duplicator &gt; Packages</strong> section and click the <strong>Create New</strong> button in the top right corner. Give a name to your package and click <strong>Next</strong>.&nbsp;</li></ol>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-1.png\" alt=\"migrate a WordPress site\" class=\"wp-image-134919\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-1.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-1-300x88.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-1-1024x301.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-1-768x226.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-1-1536x452.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>At this stage Duplicator will scan your site and let you know if there are any potential issues. If there are problems highlighted, resolve them and scan again before proceeding.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-2.png\" alt=\"migrate a WordPress site\" class=\"wp-image-134920\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-2.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-2-300x192.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-2-1024x654.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-2-768x490.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-2-1536x981.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>2. When the backup file is ready, download it by clicking the <strong>One-Click Download</strong> link. It will download both the backup file and the <em>installer.php</em> file to your computer.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-3.png\" alt=\"\" class=\"wp-image-134921\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-3.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-3-300x152.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-3-1024x518.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-3-768x388.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/Duplicator-3-1536x777.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>3. In this step you need to create a database on your new host. This can be done in the hosting panel; for example, if it’s the cPanel, you need to log in to it and find the <strong>Databases</strong> section. In that section, select <strong>MySQL Databases</strong> and click <strong>Create a New Database</strong>. Enter a name for your database and click <strong>Create Database</strong>. Then under <strong>Add a New User</strong>, enter a username and password and click <strong>Create a User</strong>. After that, scroll down to <strong>Add a User to a Database</strong> and select the user and database you just created and click <strong>Add</strong>. On the <strong>Manage User Privileges</strong> section tick the <strong>ALL PRIVILEGES</strong> checkbox and click <strong>Make Changes</strong>.</p>\n\n\n\n<p><em>Important: You need to remember the database name, its username and the password for later actions.</em></p>\n\n\n\n<p>You can check more about managing databases in the <a href=\"https://docs.cpanel.net/cpanel/databases/mysql-databases/\" rel=\"nofollow\">cPanel documentation</a>.</p>\n\n\n\n<p>4. Upload the files you got in step 2 into the site’s root directory on your new hosting server (usually it is the <em>public_html</em> folder).&nbsp;</p>\n\n\n\n<p>5. If you are migrating the site while keeping the same domain name, then you will need to modify your hosts file on a local machine. It allows you to override which server is hit when you browse a site and real domain switch (DNS change) will be done only after the migration and testing processes are completed. It’s important to prevent any downtime. To do that, you need to determine the IP address of your new server. You can find it in the new hosting panel or just ask the new hosting provider support. Now find the hosts file on your local machine (for Windows users its location is <strong>c:\\windows\\system32\\drivers\\etc\\hosts</strong>, for Unix-based operating systems it is <strong>/etc/hosts</strong>) and in the bottom line of the file add the entry in the following view:</p>\n\n\n\n<p><strong>&nbsp;the_new_ip_address your_domain_name</strong></p>\n\n\n\n<p>For example, if the new server’s IP is <em>123.123.123.123</em> with the domain name <em>mydomain.tld</em>, the entry will be:</p>\n\n\n\n<p><strong>123.123.123.123 mydomain.tld</strong></p>\n\n\n\n<p>6. Navigate to the installer.php file in the browser by entering the address http://yourdomainname.tld/installer.php to start the installation process. In the duplicator installation wizard, enter the database credentials you created in step 3 (leave the Host field as “<em>localhost</em>”) and click the <strong>Test Connection</strong> button. If everything is fine then click <strong>Run Deployment</strong>.</p>\n\n\n\n<p>7. When the migration process is completed, test the site and then you may switch the name servers for your domain to the new host and remove the entry made in the hosts file in step 5. Note that name server changes may take effect after up to 24 hours.</p>\n\n\n\n<h2 id=\"h-the-manual-method-of-migrating-a-wordpress-site\">The manual method of migrating a WordPress site</h2>\n\n\n\n<p>Migrating a WordPress site manually requires some technical skills, as you need to move the site files and database, and then configure the wp-config.php file. Using this method you need to know how to access files via the File Manager in your hosting control panel or via FTP (File Transfer Protocol). Also, knowledge of managing the database is required, in most cases using the phpMyAdmin environment.</p>\n\n\n\n<h3 id=\"h-backing-up-your-current-wordpress-site-files-and-mysql-database\">Backing up your current WordPress site files and MySQL database</h3>\n\n\n\n<p>Files can be downloaded from the server via FTP using the <a href=\"https://filezilla-project.org/\" rel=\"nofollow\">FileZilla FTP Client</a>. After connecting to the old server, navigate to the site’s root directory (<em>public_html</em> in most cases), select all WordPress files, then open the context menu by right click and select <strong>Download</strong>.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla.png\" alt=\"migrate a WordPress site\" class=\"wp-image-134922\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-300x140.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-1024x476.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-768x357.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-1536x714.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>When the download is complete, open the phpMyAdmin tool in the hosting control panel to access the databases, select the database of your site and open the Export tab.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin.png\" alt=\"migrate a WordPress site\" class=\"wp-image-134923\" width=\"862\" height=\"400\"/></figure></div>\n\n\n\n<p>In the <strong>Export Method</strong> section select the <strong>Quick </strong>method, then choose the <strong>SQL</strong> option as the format and click the <strong>Go</strong> button.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-2.png\" alt=\"\" class=\"wp-image-134924\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-2.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-2-300x132.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-2-1024x452.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-2-768x339.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-2-1536x678.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>The database dump will be downloaded to your computer.</p>\n\n\n\n<h2 id=\"h-uploading-the-files-and-exporting-the-database-to-a-new-server\">Uploading the files and exporting the database to a new server</h2>\n\n\n\n<p>Now you can upload the site files to your new server. Connect to it via FTP with the FileZilla FTP Client and navigate to the <strong>public_html</strong> folder. From the left side of the client (Local site) locate the files you downloaded in step 1, select them all and then click <strong>Upload</strong> from the context menu.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-2.png\" alt=\"migrate a WordPress site\" class=\"wp-image-134925\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-2.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-2-300x155.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-2-1024x530.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-2-768x397.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-2-1536x795.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>While the files are uploading you can enter your new hosting panel and create a new database and note the <strong>database name, database username </strong>and <strong>database password</strong>. Then open the phpMyAdmin tool, select the created database and navigate to the <strong>Import</strong> section. In the Import screen, click <strong>Choose File</strong> and upload the database dump file you downloaded earlier and click <strong>Go</strong>.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-3.png\" alt=\"\" class=\"wp-image-134926\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-3.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-3-300x197.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-3-1024x672.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-3-768x504.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/phpMyAdmin-3-1536x1008.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>Once the upload is complete you need to edit the <strong>wp-config.php</strong> file. In FileZilla, locate wp-config.php and open it to edit.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-3.png\" alt=\"\" class=\"wp-image-134927\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-3.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-3-300x192.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-3-1024x655.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-3-768x491.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/FileZilla-3-1536x982.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>Change the following values to match your new database credentials:</p>\n\n\n\n<p>DB_NAME – database name<br>DB_USER – database username<br>DB_PASSWORD – database password<br>DB_HOST – database hostname (Usually it should be <strong>localhost</strong>, otherwise you can specify it from your new hosting provider).</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/11/wp-config.png\" alt=\"\" class=\"wp-image-134928\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/11/wp-config.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/11/wp-config-300x88.png 300w, https://themes.artbees.net/wp-content/uploads/2021/11/wp-config-1024x301.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/11/wp-config-768x226.png 768w, https://themes.artbees.net/wp-content/uploads/2021/11/wp-config-1536x452.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>And lastly, you can do the trick with the hosts file, which we described earlier, to be able to test the migrated site on a new server. If everything is working fine then you can switch nameservers for your domain to the new hosting.</p>\n\n\n\n<h2 id=\"h-conclusion\">Conclusion</h2>\n\n\n\n<p>In this article we described one type of migration of a WordPress site—moving to a new hosting provider (a new server). The benefits of this can vary, such as better customer support, more hosting resources and useful features as well as better server security. We showed two different approaches to achieve this: plugin based migration and manual migration methods. These methods can be applicable in different situations, so it’s important to know the steps of the process to prevent your site’s data loss and downtime.</p>\n\";s:9:\"protected\";b:0;}s:7:\"excerpt\";a:2:{s:8:\"rendered\";s:379:\"<p>Website migration is the process of changing a website configuration or technology that can affect its online visibility and search engine optimization. A site migration includes changes such as changing the domain name or switching the hosting provider and server location, changing the structure of the site, site redesign, moving from HTTP to HTTPS protocol [&hellip;]</p>\n\";s:9:\"protected\";b:0;}s:6:\"author\";i:80498;s:14:\"featured_media\";i:134929;s:14:\"comment_status\";s:4:\"open\";s:11:\"ping_status\";s:4:\"open\";s:6:\"sticky\";b:0;s:8:\"template\";s:0:\"\";s:6:\"format\";s:8:\"standard\";s:4:\"meta\";a:9:{s:16:\"_bbp_topic_count\";i:0;s:16:\"_bbp_reply_count\";i:0;s:22:\"_bbp_total_topic_count\";i:0;s:22:\"_bbp_total_reply_count\";i:0;s:16:\"_bbp_voice_count\";i:0;s:26:\"_bbp_anonymous_reply_count\";i:0;s:23:\"_bbp_topic_count_hidden\";i:0;s:23:\"_bbp_reply_count_hidden\";i:0;s:25:\"_bbp_forum_subforum_count\";i:0;}s:10:\"categories\";a:1:{i:0;i:10874;}s:4:\"tags\";a:5:{i:0;i:329;i:1;i:472;i:2;i:18590;i:3;i:18591;i:4;i:18592;}s:10:\"yoast_head\";s:4497:\"<!-- This site is optimized with the Yoast SEO Premium plugin v15.2.1 - https://yoast.com/wordpress/plugins/seo/ -->\n<title>How to Migrate a WordPress Site from One Hosting Server to Another</title>\n<meta name=\"description\" content=\"In this article, you can discover how to migrate your WordPress site to a new hosting provider, either manually or via plugins.\" />\n<meta name=\"robots\" content=\"index, follow, max-snippet:-1, max-image-preview:large, max-video-preview:-1\" />\n<link rel=\"canonical\" href=\"https://themes.artbees.net/blog/migrate-a-wordpress-site-from-one-hosting-server-to-another/\" />\n<meta property=\"og:locale\" content=\"en_US\" />\n<meta property=\"og:type\" content=\"article\" />\n<meta property=\"og:title\" content=\"How to Migrate a WordPress Site from One Hosting Server to Another\" />\n<meta property=\"og:description\" content=\"In this article, you can discover how to migrate your WordPress site to a new hosting provider, either manually or via plugins.\" />\n<meta property=\"og:url\" content=\"https://themes.artbees.net/blog/migrate-a-wordpress-site-from-one-hosting-server-to-another/\" />\n<meta property=\"og:site_name\" content=\"WordPress Websites For Businesses, Artists, Bloggers Shops And More\" />\n<meta property=\"article:publisher\" content=\"https://www.facebook.com/artbees\" />\n<meta property=\"article:published_time\" content=\"2021-11-04T16:17:30+00:00\" />\n<meta property=\"article:modified_time\" content=\"2021-11-04T16:52:23+00:00\" />\n<meta property=\"og:image\" content=\"https://themes.artbees.net/wp-content/uploads/2021/11/blog-migrate-hosting.png\" />\n	<meta property=\"og:image:width\" content=\"1200\" />\n	<meta property=\"og:image:height\" content=\"600\" />\n<meta name=\"twitter:card\" content=\"summary_large_image\" />\n<meta name=\"twitter:creator\" content=\"@artbees_design\" />\n<meta name=\"twitter:site\" content=\"@artbees_design\" />\n<meta name=\"twitter:label1\" content=\"Written by\">\n	<meta name=\"twitter:data1\" content=\"Alexander Hutsol\">\n	<meta name=\"t