\";s:63:\"https://themes.artbees.net/wp-json/wp/v2/posts/134716/revisions\";}}s:19:\"predecessor-version\";a:1:{i:0;a:2:{s:2:\"id\";i:134744;s:4:\"href\";s:70:\"https://themes.artbees.net/wp-json/wp/v2/posts/134716/revisions/134744\";}}s:16:\"wp:featuredmedia\";a:1:{i:0;a:2:{s:10:\"embeddable\";b:1;s:4:\"href\";s:53:\"https://themes.artbees.net/wp-json/wp/v2/media/134733\";}}s:13:\"wp:attachment\";a:1:{i:0;a:1:{s:4:\"href\";s:60:\"https://themes.artbees.net/wp-json/wp/v2/media?parent=134716\";}}s:7:\"wp:term\";a:2:{i:0;a:3:{s:8:\"taxonomy\";s:8:\"category\";s:10:\"embeddable\";b:1;s:4:\"href\";s:63:\"https://themes.artbees.net/wp-json/wp/v2/categories?post=134716\";}i:1;a:3:{s:8:\"taxonomy\";s:8:\"post_tag\";s:10:\"embeddable\";b:1;s:4:\"href\";s:57:\"https://themes.artbees.net/wp-json/wp/v2/tags?post=134716\";}}s:6:\"curies\";a:1:{i:0;a:3:{s:4:\"name\";s:2:\"wp\";s:4:\"href\";s:23:\"https://api.w.org/{rel}\";s:9:\"templated\";b:1;}}}}i:2;a:25:{s:2:\"id\";i:133774;s:4:\"date\";s:19:\"2021-10-20T12:25:32\";s:8:\"date_gmt\";s:19:\"2021-10-20T09:25:32\";s:4:\"guid\";a:1:{s:8:\"rendered\";s:36:\"https://themes.artbees.net/?p=133774\";}s:8:\"modified\";s:19:\"2021-10-20T12:25:36\";s:12:\"modified_gmt\";s:19:\"2021-10-20T09:25:36\";s:4:\"slug\";s:50:\"customize-woocommerce-subscription-email-templates\";s:6:\"status\";s:7:\"publish\";s:4:\"type\";s:4:\"post\";s:4:\"link\";s:83:\"https://themes.artbees.net/blog/customize-woocommerce-subscription-email-templates/\";s:5:\"title\";a:1:{s:8:\"rendered\";s:57:\"How to Customize WooCommerce Subscription Email Templates\";}s:7:\"content\";a:2:{s:8:\"rendered\";s:20332:\"\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full\"><img width=\"1200\" height=\"600\" src=\"https://themes.artbees.net/wp-content/uploads/2021/10/blog-customize-email.png\" alt=\"\" class=\"wp-image-133775\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/10/blog-customize-email.png 1200w, https://themes.artbees.net/wp-content/uploads/2021/10/blog-customize-email-300x150.png 300w, https://themes.artbees.net/wp-content/uploads/2021/10/blog-customize-email-1024x512.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/10/blog-customize-email-768x384.png 768w\" sizes=\"(max-width: 1200px) 100vw, 1200px\" /></figure></div>\n\n\n\n<p class=\"has-background\" style=\"background-color:#c1e5fa\">This is a guest post contributed to Artbees Themes blog by Thuy Nguyen from Ninja Team.</p>\n\n\n\n<p>By offering subscription products such as news, summaries, courses, or even food, you can generate recurring stable revenue with WooCommerce subscription email templates.</p>\n\n\n\n<p>Subscription-based products have a special business model that requires a strong digital presence. Brand print via email communications is a must.</p>\n\n\n\n<p>Therefore, visual continuity is essential at all subscriber touchpoints, including your website, social media channels, and transactional emails. In today’s article, we’ll be showing you how to do that by customizing <a href=\"https://yaycommerce.com/yaymail-woocommerce-email-customizer/\">WooCommerce subscription email templates</a> without coding using YayMail.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/10/Email-design-with-YayMail.jpg\" alt=\"\" class=\"wp-image-133792\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/10/Email-design-with-YayMail.jpg 1720w, https://themes.artbees.net/wp-content/uploads/2021/10/Email-design-with-YayMail-300x178.jpg 300w, https://themes.artbees.net/wp-content/uploads/2021/10/Email-design-with-YayMail-1024x609.jpg 1024w, https://themes.artbees.net/wp-content/uploads/2021/10/Email-design-with-YayMail-768x457.jpg 768w, https://themes.artbees.net/wp-content/uploads/2021/10/Email-design-with-YayMail-1536x914.jpg 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<h2 id=\"h-install-required-plugins\">Install required plugins</h2>\n\n\n\n<p>In this tutorial, I’m using these plugins:</p>\n\n\n\n<ul><li><strong>WooCommerce Subscriptions</strong>: to create subscriptions via WooCommerce and sell subscription-based products or services</li><li><strong>WooCommerce Stripe Gateway</strong>: to handle recurring payments with Stripe&nbsp;</li><li><strong>YayMail</strong>: the free <a href=\"https://wordpress.org/plugins/yaymail/\" rel=\"nofollow\">email template builder</a> that support 50+ third-party extensions in its addons</li><li><strong>YayMail Addon for WooCommerce Subscriptions</strong>: integration of email customizer for subscription emails</li><li><strong>YayMail Addon for WooCommerce Stripe Gateway</strong>: integration of email customizer for Stripe’s payment reminder email templates</li></ul>\n\n\n\n<p>If you haven’t decided on which Woo subscription plugin to use, please check out our blog post on how to <a href=\"https://themes.artbees.net/blog/subscription-store-with-woocommerce/\">Create a Subscription Store with WooCommerce</a>. In&nbsp; this article, you will learn the pros and cons of each plugin in order to make an informed purchase. No matter which one you choose, the customization workflow will be the same as presented in this walk-through.</p>\n\n\n\n<p>Let’s get started!</p>\n\n\n\n<h2 id=\"h-design-the-general-template-layout\">Design the general template layout</h2>\n\n\n\n<p>By default, the WooCommerce plugin alone comes with 11 transactional email templates. The <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/\" rel=\"nofollow\">WooCommerce Subscriptions</a> extension comes with another 10 email templates and WooCommerce Stripe Gateway adds even more templates for payment status reminders.&nbsp;<br>That’s quite a lot, right? But don’t fret, all of these subscription email templates are located in one place under <strong>WooCommerce</strong> &gt; <strong>Settings</strong> &gt; <strong>Emails</strong>.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-subscription-email-settings-dashboard.png\" alt=\"\" class=\"wp-image-133793\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-subscription-email-settings-dashboard.png 1720w, https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-subscription-email-settings-dashboard-300x174.png 300w, https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-subscription-email-settings-dashboard-1024x595.png 1024w, https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-subscription-email-settings-dashboard-768x447.png 768w, https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-subscription-email-settings-dashboard-1536x893.png 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>Alternatively, you can also find the email templates by navigating to <strong>WooCommerce</strong> &gt; <strong>Email Customizer</strong>.</p>\n\n\n\n<p>In the email builder interface, please go to Settings &gt; Enable/Disable Templates to find all the available email templates. There, you can choose to activate all the templates you want to put in use.</p>\n\n\n\n<p>For each enabled template, you will see a green light indicating that it is now being used in the automation workflow of WooCommerce.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/10/Enable-and-disable-subscription-email-templates.jpg\" alt=\"\" class=\"wp-image-133794\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/10/Enable-and-disable-subscription-email-templates.jpg 1720w, https://themes.artbees.net/wp-content/uploads/2021/10/Enable-and-disable-subscription-email-templates-300x153.jpg 300w, https://themes.artbees.net/wp-content/uploads/2021/10/Enable-and-disable-subscription-email-templates-1024x521.jpg 1024w, https://themes.artbees.net/wp-content/uploads/2021/10/Enable-and-disable-subscription-email-templates-768x391.jpg 768w, https://themes.artbees.net/wp-content/uploads/2021/10/Enable-and-disable-subscription-email-templates-1536x781.jpg 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>Also in the same <strong>Settings</strong> tab, you’ll be able to design the general layout of email templates. These options include universal display components like:</p>\n\n\n\n<ul><li>Language direction: it is left to right by default.</li><li>Container width: the width of the whole email body. It is 900px by default but 700px in the sample image.</li><li>Product image: automatically insert any product image with a custom position and image size.</li><li>Custom CSS: add your own creative adjustments.</li><li>Export and import email templates: keep a full template backup or use your customized email templates on different sites.</li></ul>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/10/General-settings-of-email-builder.jpg\" alt=\"\" class=\"wp-image-133795\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/10/General-settings-of-email-builder.jpg 1720w, https://themes.artbees.net/wp-content/uploads/2021/10/General-settings-of-email-builder-300x226.jpg 300w, https://themes.artbees.net/wp-content/uploads/2021/10/General-settings-of-email-builder-1024x770.jpg 1024w, https://themes.artbees.net/wp-content/uploads/2021/10/General-settings-of-email-builder-768x578.jpg 768w, https://themes.artbees.net/wp-content/uploads/2021/10/General-settings-of-email-builder-1536x1156.jpg 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>In the sample image I’ve changed the email background color to light mint and the text link color to dodger blue. Feel free to play around with colors before we move on to the next steps.</p>\n\n\n\n<h2>Customizing welcome email template for new subscribers</h2>\n\n\n\n<p>After finishing the general options, you can now move along to&nbsp; a specific subscription email template such as <strong>New customer welcome email template</strong> for onboarding subscribers.</p>\n\n\n\n<p>In the WooCommerce subscription flow, the first email your subscriber receives after signing up is called <strong>Processing order</strong>. Choose it from the dropdown list and then we can start to transform it into a more appealing welcome email template.</p>\n\n\n\n<h3>Logo and email header</h3>\n\n\n\n<p>Similar to Gutenberg blocks, you can upload and insert your logo very quickly. For this logo block, I set its background color with the same light mint color as the email background.</p>\n\n\n\n<p>Alternatively, you can use a full width banner or an animated GIF in your email to emphasize your brand and its personality.</p>\n\n\n\n<p>Then, with the email heading block, I pick a darker mint color for its background. After that, I just add some custom text and tweak it:</p>\n\n\n\n<ul><li>Change text color: use the built-in color picker or paste your own HEX color</li><li>Change font family: choose one of the email-safe fonts listed under “Font Family” option</li><li>Align and format the text further if necessary</li></ul>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/10/Customize-email-heading-in-subscription-email.jpg\" alt=\"\" class=\"wp-image-133796\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/10/Customize-email-heading-in-subscription-email.jpg 1720w, https://themes.artbees.net/wp-content/uploads/2021/10/Customize-email-heading-in-subscription-email-300x143.jpg 300w, https://themes.artbees.net/wp-content/uploads/2021/10/Customize-email-heading-in-subscription-email-1024x489.jpg 1024w, https://themes.artbees.net/wp-content/uploads/2021/10/Customize-email-heading-in-subscription-email-768x367.jpg 768w, https://themes.artbees.net/wp-content/uploads/2021/10/Customize-email-heading-in-subscription-email-1536x734.jpg 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>After I am satisfied with my email header, I can continue with the main email content using text blocks such as:</p>\n\n\n\n<ul><li>Welcome greetings</li><li>Announcement of the subscription registration, and a bit more of what you have to offer</li><li>WooCommerce subscription detail table</li></ul>\n\n\n\n<h3>Multiple column email section</h3>\n\n\n\n<p>Now it’s time to add some fancy media sections to the onboarding subscription email template. Here you can unleash your designer vision with an advanced multiple column block.</p>\n\n\n\n<p>Here are some ideas to help you out with what to put in new subscriber email templates:</p>\n\n\n\n<ul><li>Setup instructions</li><li>Upcoming events and webinars</li><li>Merchandise and badges</li><li>Other useful links and resources</li></ul>\n\n\n\n<p>It’s easy to implement this media section by following these steps:</p>\n\n\n\n<ul><li>Add a three column block: set portion width, padding, background color or add an image</li><li>Drag and drop content blocks into each column</li><li>Insert buttons into columns: edit button color and text font/text color</li></ul>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/10/Multiple-column-email-section.jpg\" alt=\"WooCommerce subscription email templates - multiple column email\" class=\"wp-image-133797\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/10/Multiple-column-email-section.jpg 1720w, https://themes.artbees.net/wp-content/uploads/2021/10/Multiple-column-email-section-300x138.jpg 300w, https://themes.artbees.net/wp-content/uploads/2021/10/Multiple-column-email-section-1024x472.jpg 1024w, https://themes.artbees.net/wp-content/uploads/2021/10/Multiple-column-email-section-768x354.jpg 768w, https://themes.artbees.net/wp-content/uploads/2021/10/Multiple-column-email-section-1536x708.jpg 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>Feel free to add more images or videos to build excitement for your products with new subscribers and include gentle CTAs for further actions.</p>\n\n\n\n<h3>Email footer and signature</h3>\n\n\n\n<p>As for the email footer, this is where you can include post-purchase details such as customer service number, return or refund policy, company signature, QR code, etc.</p>\n\n\n\n<p>Here I want to minimize those details so I only include social media profiles and the website tagline/company slogan.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/10/Add-social-profile-to-email-signature.jpg\" alt=\"WooCommerce subscription email templates - customize email heading\" class=\"wp-image-133799\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/10/Add-social-profile-to-email-signature.jpg 1720w, https://themes.artbees.net/wp-content/uploads/2021/10/Add-social-profile-to-email-signature-300x152.jpg 300w, https://themes.artbees.net/wp-content/uploads/2021/10/Add-social-profile-to-email-signature-1024x520.jpg 1024w, https://themes.artbees.net/wp-content/uploads/2021/10/Add-social-profile-to-email-signature-768x390.jpg 768w, https://themes.artbees.net/wp-content/uploads/2021/10/Add-social-profile-to-email-signature-1536x780.jpg 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>Within YayMail’s email builder, you can find a dedicated <strong>Social Icon</strong> block for showcasing your online presence. This enhancement provides customizable options including:</p>\n\n\n\n<ul><li>Social icon row paddings</li><li>Icon width and spacing</li><li>Various pre-set styles&nbsp;</li><li>Links to social media networks and home page</li><li>Optionally add or remove social media icons</li></ul>\n\n\n\n<p>After all of the customization work, our email template looks&nbsp; like this:</p>\n\n\n\n<h2>Customizing payment reminder email templates</h2>\n\n\n\n<p>When it comes to processing renewal payments, there are many scenarios that cause failed authentication. When this happens, Stripe Payment Gateway automatically sends payment reminder emails to the subscribers.</p>\n\n\n\n<p>The WooCommerce email template <strong>Failed Subscription Renewal SCA Authentication</strong> gives a heads up to your customers:</p>\n\n\n\n<ul><li>To inform that an attempt to automatically process a subscription renewal payment has failed,&nbsp;</li><li>To explain that the transaction requires an SCA verification,&nbsp;</li><li>To request the customer to authenticate the payment, and a retry rule has been applied to notify the customer again within a certain time period.</li></ul>\n\n\n\n<p>That said, please prepare a reminder copy that helps clarify the issue and what actions you want your&nbsp; subscriber to take.</p>\n\n\n\n<p>Here’s what my copy looks like:&nbsp;</p>\n\n\n\n<p>“The automatic payment to renew your subscription with [yaymail_site_name] has failed. To reactivate your subscription, please login and authorize the renewal from your account page: Authorize the payment »”</p>\n\n\n\n<p>After that, you can go to the email builder and reuse the newly customized email template to develop a consistent brand experience.</p>\n\n\n\n<p>To save valuable time, it’s wise to duplicate an email template so that you don’t have to design it over again. To do this, simply follow these steps:</p>\n\n\n\n<ul><li>Select the current email template, eg: Payment Authentication Failed</li><li>Click on the button “Copy template” from the upper toolbar</li><li>Choose a particular template from which you want to copy all designed blocks, eg: Processing order</li><li>Click <strong>Copy template</strong> to have the new draft right on your current email template</li></ul>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/10/Copy-full-template-from-another-email.jpg\" alt=\"WooCommerce subscription email templates - copy full template\" class=\"wp-image-133800\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/10/Copy-full-template-from-another-email.jpg 1720w, https://themes.artbees.net/wp-content/uploads/2021/10/Copy-full-template-from-another-email-300x184.jpg 300w, https://themes.artbees.net/wp-content/uploads/2021/10/Copy-full-template-from-another-email-1024x628.jpg 1024w, https://themes.artbees.net/wp-content/uploads/2021/10/Copy-full-template-from-another-email-768x471.jpg 768w, https://themes.artbees.net/wp-content/uploads/2021/10/Copy-full-template-from-another-email-1536x942.jpg 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>Then you’ll have a full template cloned from the Processing order’s template. Now go ahead and omit the blocks that you find unsuitable or unnecessary.</p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full is-resized\"><img src=\"https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-Subscription-Email-Templates.jpg\" alt=\"WooCommerce subscription email templates\" class=\"wp-image-133858\" width=\"862\" srcset=\"https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-Subscription-Email-Templates.jpg 1720w, https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-Subscription-Email-Templates-300x197.jpg 300w, https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-Subscription-Email-Templates-1024x672.jpg 1024w, https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-Subscription-Email-Templates-768x504.jpg 768w, https://themes.artbees.net/wp-content/uploads/2021/10/WooCommerce-Subscription-Email-Templates-1536x1008.jpg 1536w\" sizes=\"(max-width: 1720px) 100vw, 1720px\" /></figure></div>\n\n\n\n<p>For situational guides, you can even add an extra text box to the email body with additional information.&nbsp;</p>\n\n\n\n<p>It is as easy as pie! When the email templates look just as you wish, click <strong>Save</strong> to finish.</p>\n\n\n\n<h2>Subscription email best practices</h2>\n\n\n\n<p>So we have guided you through the very basic steps of customizing subscription welcome and reminder emails.&nbsp;</p>\n\n\n\n<p>While it is intuitive to design with this drag and drop email builder, here are the best practices to save you more time:</p>\n\n\n\n<ul><li>When you add external links to the email templates, they could appear as insecure links and the template won’t be able to be saved. You can troubleshoot this problem by trying to reset the template.</li><li>There are many shortcodes and variables to insert personalized information into the subscription email templates. You can find them in any textbox element or from the (i) Shortcode button.</li><li>At any point in time, you can save and preview the current template on desktop or mobile interface.</li><li>Before enabling the email templates, you can send a test email anytime to make sure it looks good on different email clients and devices.</li><li>You can try sending different email templates in real life to find out which layout brings the highest WooCommerce <a href=\"https://themes.artbees.net/blog/improve-woocommerce-conversion-rate/\">conversion rate</a>.</li></ul>\n\n\n\n<h2>Wrapping Up</h2>\n\n\n\n<p>WooCommerce subscription email templates are expected and contain important information. These emails have a high open-rate. While you don’t want to promote hard via these emails, you do have the chance to give incentives for sharing your products, or simply ask for a review.</p>\n\n\n\n<p>With the help of <a href=\"https://yaycommerce.com/yaymail-woocommerce-email-customizer/#yaymail-addon-woo-subscriptions\">YayMail – WooCommerce Email Customizer</a>, you have a simple way to build a successful relationship with your subscribers.</p>\n\n\n\n<p>Have any templates that you want to share? Don’t hesitate to let us know in the comment section below.</p>\n\";s:9:\"protected\";b:0;}s:7:\"excerpt\";a:2:{s:8:\"rendered\";s:392:\"<p>This is a guest post contributed to Artbees Themes blog by Thuy Nguyen from Ninja Team. By offering subscription products such as news, summaries, courses, or even food, you can generate recurring stable revenue with WooCommerce subscription email templates. Subscription-based products have a special business model that requires a strong digital presence. Brand print via [&hellip;]</p>\n\";s:9:\"protected\";b:0;}s:6:\"author\";i:99258;s:14:\"featured_media\";i:133775;s:14:\"comment_status\";s:4:\"open\";s:11:\"ping_status\";s:4:\"open\";s:6:\"sticky\";b:0;s:8:\"template\";s:0:\"\";s:6:\"format\";s:8:\"standard\";s:4:\"meta\";a:9:{s:16:\"_bbp_topic_count\";i:0;s:16:\"_bbp_reply_count\";i:0;s:22:\"_bbp_total_topic_count\";i:0;s:22:\"_bbp_total_reply_count\";i:0;s:16:\"_bbp_voice_count\";i:0;s:26:\"_bbp_anonymous_reply_count\";i:0;s:23:\"_bbp_topic_count_hidden\";i:0;s:23:\"_bbp_reply_count_hidden\";i:0;s:25:\"_bbp_forum_subforum_count\";i:0;}s:10:\"categories\";a:1:{i:0;i:10874;}s:4:\"tags\";a:2:{i:0;i:18585;i:1;i:18586;}s:10:\"yoast_head\";s:4635:\"<!-- This site is optimized with the Yoast SEO Premium plugin v15.2.1 - https://yoast.com/wordpress/plugins/seo/ -->\n<title>How to Customize WooCommerce Subscription Email Templates</title>\n<meta name=\"description\" content=\"In this blog post we provide an overview of how to create, manage and customize WooCommerce subscription email templates.\" />\n<meta name=\"robots\" content=\"index, follow, max-snippet:-1, max-image-preview:large, max-video-preview:-1\" />\n<link rel=\"